import Stack from '@mui/material/Stack';
import React from 'react';
import 'remixicon/fonts/remixicon.css'
import './Settings.css'
import cube from './Images/Cube.png';



function SettingsMaster(){
    return(
        <div>
        <SettingsLand/>
        <Notifications/>
        </div>
    )
}
function SettingsLand(){
    return(
        <div className="" style={{textAlign: 'center'}}>
           <Stack direction="column" spacing={2} justifyContent="center" alignItems="center">
            <h1 style={{textAlign: 'center'}}>Settings</h1>
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center', fontStyle: 'italic', fontSize: '22px'}}>Donovan Rivers</p>
            <p style={{textAlign: 'center', fontStyle: 'italic', fontSize: '22px'}}>May Realities, Inc.</p>
            </Stack>
        </div>
    )
}
function Notifications(){
    return(
        <div>
            <p style={{textAlign: 'center'}}>Recieve Email Alerts</p>
            <p style={{textAlign: 'center'}}></p>
            <Stack spacing={2} direction="column" justifyContent="center" alignItems="center">
            <div id="autoScroll" className="buttonParent" style={{textAlign: 'center', width: '1020px', height: '250px', overflowX: 'auto', whiteSpace: 'nowrap', textOverflow: 'ellipsis', scrollBehavior: 'smooth', color: 'black'}}>
                <h1></h1>
            </div>
        </Stack>
        </div>
    )
}
export default SettingsMaster;
